import { HashRouter,  Route, Switch } from 'react-router-dom';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

import LoginPage from 'src/pages/login/LoginPage';


function App() {
  return (
    <div className="App">
      <HashRouter>
        <Switch>
          <Route exact path="/">LoginPage</Route>
        </Switch>
      </HashRouter>

    </div>

  );
}

export default App;
